 NEXT : 'next',
 PREV : 'prev',
 LEFT : 'left',
 RIGHT : 'right'
 }

 const Event = {
 SLIDE : `slide${EVENT_KEY}`,
 SLID : `slid${EVENT_KEY}`,
 KEYDOWN : `keydown${EVENT_KEY}`,
 MOUSEENTER : `mouseenter${EVENT_KEY}`,
 MOUSELEAVE : `mouseleave${EVENT_KEY}`,
 TOUCHEND : `touchend${EVENT_KEY}`,
