 if (this._isTransitioning || this._isShown) {
 return
 }

 if (Util.supportsTransitionEnd() && $(this._element).hasClass(ClassName.FADE)) {
 this._isTransitioning = true
 }

 const showEvent = $.Event(Event.SHOW, {
 relatedTarget
 })

 $(this._element).trigger(showEvent)

