 * jQuery
 * ------------------------------------------------------------------------
 */

 $.fn[NAME] = Modal._jQueryInterface
 $.fn[NAME].Constructor = Modal
 $.fn[NAME].noConflict = function () {
 $.fn[NAME] = JQUERY_NO_CONFLICT
 return Modal._jQueryInterface
 }

 return Modal

