 * ------------------------------------------------------------------------
 * jQuery
 * ------------------------------------------------------------------------
 */

 $.fn[NAME] = Tooltip._jQueryInterface
 $.fn[NAME].Constructor = Tooltip
 $.fn[NAME].noConflict = function () {
 $.fn[NAME] = JQUERY_NO_CONFLICT
 return Tooltip._jQueryInterface
 }

 return Tooltip

})($, Popper)

