 this._element = element
 }


 // getters

 static get VERSION() {
 return VERSION
 }


 // public

 show() {
 if (this._element.parentNode &&
 this._element.parentNode.nodeType === Node.ELEMENT_NODE &&
 $(this._element).hasClass(ClassName.ACTIVE) ||
 $(this._element).hasClass(ClassName.DISABLED)) {
 return
